import React from 'react'

const Topbar=() =>{
  return (
    <nav class="navbar bg-primary bg-body-tertiary">
    <div class="container-fluid">
      <span class="navbar-brand mb-0 h1">Navbar</span>
    </div>
  </nav>
  )
}

export default Topbar
